import {useState} from "react";

function PostItem() {
  const [posts, setPosts] = useState([]);

  fetch("https://jsonplaceholder.typicode.com/posts?_limit=10", {
    method: "GET",
  })
    .then((res) => res.json)
    .then((data) => console.log(data));
}

export default PostItem;
